import style from "./Home.module.css";
import Container from "../layout/Container";
import ImgE from "../img/empresas.jpg";
import Astronaut from '../img/astronaut.svg'

export default function Home() {
  return (
    <Container>
      <div className={style.father}>
        <h1>Bem vindo</h1>
        <p>
          Conheço as empresas cadastradas e descubrar mais sobre elas e seus
          negocios.
          <br />
          Descobrindo seus contatos e meios de comunição.
        </p>
        <img src={Astronaut} alt="imagem de empresas" />
        
        <img src={ImgE} alt="imagem de empresas" />
        <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Perferendis doloribus impedit dicta deleniti similique officia odio ratione, illo voluptatum? Blanditiis eaque at sequi voluptas, minima ducimus itaque soluta ex nisi alias id fugit dignissimos! Nulla saepe, maiores esse molestias quo commodi porro? Neque fugit, tempore omnis necessitatibus eaque molestias aut.</p>
      </div>
    </Container>
  );
}
